My beauty 2022 favorites 👇🏼💄

@caiacosmetics: That dewy look — makes my skin set perfectly through the whole day!

@diorbeauty Vanilla Diorama — my new favorite scent. Smells feminine, vanilla (ofc, haha!) and it reminds me of France!

@lamer crème de la mer — no intro needed.. I’m using this almost every day and it’s a real lifesaver, especially if my skin is a bit messy. 

@bjorkhair Tämja — a new favorite this year. It makes my hair softer, includes heat protector and smells wonderful! 

@diorbeauty Forever skin correct — my bags under my eyes are Dior and I won’t change that ever because if so, I’ll look like a panda 🐼 

@lamer The renewal oil — I didn’t know I needed this until I got it. Using it every day during winter ❄️

@lumene Instant glow Beauty serum — My all time favorite as it gives such a natural resolution and stays beautiful during the whole day 🤍

@drbarbarasturm Hyaluronic serum — Using this every-single-day!

@diorbeauty Diorshow mascara — makes my lashes loooooong and pure black.. Stays on and doesn’t crack during the day 🖤 

@livingproofinc Triple bond complex — this beauty surprised me and I’m using it once a week after detox shampoo!

@masonpearsonbros brush — I’m having fine Scandinavian hair and this is one of the best brushes I’ve had even though I’m using @hairtalkextensions

#lamer #lamerskincare #caiacosmetics #louisvuitton #louisvuittonnice #diorbeauty #diorbeautylovers #drbarbarasturm #lumene
